    methods: {
        /**
         * 初始化画布，并反序列化初始数据
         */
        init() {
            graph = new Graph({
                container: document.getElementById('container'),
                // 显示网格
                grid: {visible: true},
                // 滚轮缩放 MouseWheel
                scroller: {
                    enabled: false,
                    pageVisible: false, // 是否分页
                    pageBreak: false,
                    pannable: true, // 是否平移
                },
                mousewheel: {
                    enabled: true,
                    modifiers: ['ctrl', 'meta'],
                },
            });
            graph.fromJSON(this.rawSource)
            // 居中展示
            graph.centerContent()

            // 拖拽初始化
            const options = {
                target: graph,
                scaled: false,
                animation: true,
            }
            dnd = new Addon.Dnd(options)
        },
        /**
         * 拖拽 添加节点
         * @param e
         */
        addNode(e) {
            const target = e && e.target.closest('.thumbnail-img') // 匹配特定选择器且离当前元素最近的祖先元素
            if (target) {
                const svg = target.getAttribute('data-config')
                const diagramName = target.getAttribute('data-name')
                const newNode = graph.createNode({
                    markup: svg,
                    tools: ['button-remove'], // 使用工具
                })
                dnd.start(newNode, e)
            }
        },
        /**
         * 保存，保存序列化后的数据，并生成图片
         */
        save() {
            const res = graph.toJSON()
            this.rawSource = res
            console.log(JSON.stringify(res))
            graph.toPNG((dataUri) => {
                // 下载
                DataUri.downloadDataUri(dataUri, `${new Date().toLocaleString()}.chart.png`)
            }, {
                // 导出的图片参数
                width: 1220,
                height: 926,
            })
        },
